import styles from './Header.module.css';

const Header = () => (
    <header className={styles.header}>
        <h1 className="App-heading glitch">
            Cher
            <span className="App-heading App-heading-presentation glow" role="presentation"></span>
            <span className="App-heading-presentation-layer" role="presentation">Cher</span>
        </h1>
        <h2>Principal Software Engineer</h2>
        <h2>Hot Sauce Maker</h2>
    </header>
);

export default Header;
